        private List<ApplicationUser> GetHeManSeedUsers()
        {
            var list = new List<ApplicationUser>();

            var userInfo = GetUserData();
            for (int i = 0; i < 10; i++)
            {
                list.Add(new ApplicationUser()
                {
                    Email = userInfo[i].Email,
                    NormalizedEmail = userInfo[i].Email.ToUpper(),
                    EmailConfirmed = false,
                    PhoneNumberConfirmed = false,
                    TwoFactorEnabled = false,
                    LockoutEnabled = true,
                    AccessFailedCount = 0,
                    FirstName = userInfo[i].FirstName,
                    LastName = userInfo[i].LastName,
                    UserName = userInfo[i].UserName,
                    NormalizedUserName = userInfo[i].UserName.ToUpper(),
                    Id = userInfo[i].Id,
                    PasswordHash = "AQAAAAEAACcQAAAAEEaVdImtFJ7OD/Ez122e8yNQCjVYZKs4OG3SHAd6lEqT1F+Nev3iA1mfIbFwK0tWmA==", //Heman2022
                    SecurityStamp = "VRGQDYI6QNIBK47FRKN6JUPT3YQE2CYG",
                    ConcurrencyStamp = "a5e68fc4-12a2-4817-85c9-32b99f7899e8",
                    PictureData = userInfo[i].PictureData,
                    PictureType = userInfo[i].PictureType
                });
            }

            return list;
        }
        private List<IdentityUserRole<string>> GetHeManUserRoles()
        {
            var list = new List<IdentityUserRole<string>>();

            var userInfo = GetUserData();
            foreach (var user in userInfo)
            {
                if (user.IsAdmin)
                {
                    list.Add(
                        new IdentityUserRole<string>
                        {
                            RoleId = IdentityRoles.AdminId,
                            UserId = user.Id
                        }
                    );
                }
                list.Add(
                    new IdentityUserRole<string>
                    {
                        RoleId = IdentityRoles.BasicId,
                        UserId = user.Id
                    }
                );
            }

            return list;
        }
